import React,{ Component } from "react";

class BookFavorite extends Component {
  render() {
    const fav = this.props.booksfav.map(item => (
      <div className="listbook" key={item.id}>
        
      </div>
    ));
    return (
      <div>
        <h2>Favorite</h2>
        {fav}
      </div>
    );
  }
}

export default BookFavorite;
